function App() {
  return (
    <Router>
     <div>
      <Routes>
       <Route exact path='/' element={<Home/>}></Route>
       <Route exact path='/login' element={<Login/>}></Route>
       <Route exact path='/creatuser' element={<Signup/>}></Route>
      </Routes>
     </div>
    </Router>
  );
}

export default App;
